class Solution {
    public long numberOfPowerfulInt(long start, long finish, int limit, String s) {
        long count = 0;
        long sVal = Long.parseLong(s);
        if (sVal < start || sVal > finish) return 0;

        // Calculate the range of numbers that can prefix s.
        long minVal = sVal;
        long maxVal = Long.parseLong(s);
        int sLength = s.length();
        long multiplier = 1;
        for (int i = 0; i < sLength; i++) {
            multiplier *= 10;
        }

        for (long prefix = 0; prefix < multiplier; prefix++) {
            long num = prefix * multiplier + sVal;
            if (num >= start && num <= finish) {
                boolean isValid = true;
                long temp = prefix;
                while (temp > 0) {
                    if (temp % 10 > limit) {
                        isValid = false;
                        break;
                    }
                    temp /= 10;
                }
                if (isValid) count++;
            }
            if (num > finish) break;
        }

        return count;
    }
}
